import Terminal from 'react-console-emulator'
import commands from '../components/Commands/commands.js'
import React, {useEffect, useState} from 'react'
import getcat from '../components/utils/cat';
import PropTypes from 'prop-types';

//export default function Term() {
const Term = (props) => {
    const cmds = commands.commands
    const owrs = commands.overwrites
    const terminal = React.createRef()
    const [prompt, setPrompt] = React.useState("Peac(ðŸ¦š)ck>")
    const [home, sethome] = React.useState('ashterm')
    const [dir, setdir] = React.useState({
        'ashterm': []
    })
    const welcomeimgae = ""
    return (
        <Terminal
            ref={terminal}
            welcomeMessage={[
                // "welcome peacock",
                <img src={`data:image/png;base64,${welcomeimgae}`} width="100px" height="80px"/>
            ]}
            commands={{
                clear: {
                    description: 'Clears the terminal',
                    usage: 'clear',
                    fn: () => {
                        terminal.current.clearStdout()
                    }
                },
                cat: {
                    description: 'Get a random cute cat~',
                    usage: 'cat',
                    fn: async () => {
                        const url = await getcat()
                        terminal.current.pushToStdout("getting a cute cat for you..\n---\n")
                        terminal.current.pushToStdout(<img src={url} width="500px" height="380px" alt='cat'></img>)
                    }
                },
                cd: {
                    description: 'Change directory, not really, lol!',
                    usage: 'cd <directory>',
                    fn: (...args) => {
                        if (args.length === 1 && args[0] === '..') {
                            if (prompt === "Peac(ðŸ¦š)ck>") {
                                return 'cannot go up'
                            } else {
                                setPrompt(prompt.substring(0, prompt.lastIndexOf('/')) + ">")
                                sethome(prompt.substring(prompt.lastIndexOf('/', prompt.lastIndexOf('/') - 1) + 1, prompt.lastIndexOf('/')))
                                //console.log(prompt.substring(prompt.lastIndexOf('/', prompt.lastIndexOf('/')-1)+1, prompt.lastIndexOf('/')))
                                //console.log(prompt.lastIndexOf('/', prompt.lastIndexOf('/')-1))
                                //console.log(prompt.lastIndexOf('/'))
                                return 'changed directory'
                            }
                        } else {
                            if (dir[home].includes(args[0])) {
                                setPrompt(`${prompt.slice(0, -4) + "/" + args.join('/') + ">"}`)
                                sethome(args.join('/'))
                                //console.log(prompt.slice(0, -4)+ "/" + args.join('/'))
                                return 'changed directory'
                            } else {
                                return 'cannot find directory'
                            }
                        }

                    }
                },
                ls: {
                    description: 'List files in the current directory',
                    usage: 'ls',
                    fn: () => {
                        if (dir[home].length === 0) {
                            return 'nothing here :(\nUse mkdir to create a dir inside this one.'
                        } else {
                            return dir[home].join('\n')
                        }
                    }

                },
                mkdir: {
                    description: 'Make a directory',
                    usage: 'mkdir <directory>',
                    fn: (...args) => {
                        if (args.length === 1) {
                            setdir({
                                ...dir,
                                [home]: [...dir[home], args[0]],
                                [args[0]]: []
                            })
                            //console.log(dir)
                            return `created directory ${args[0]}.`
                        } else {
                            return 'invalid arguments'
                        }
                    }
                },
                help: {
                    description: 'List all available commands',
                    usage: 'help',
                    fn: () => {
                        return `
                            ${Object.keys(owrs).map(cmd => `${cmd}${"â€ˆ".repeat(12 - cmd.length)} | ${owrs[cmd].description}${"â€ˆ".repeat(39 - owrs[cmd].description.length)} `).join('\n')}
                            ${Object.keys(cmds).map(cmd => `${cmd}${"â€ˆ".repeat(12 - cmd.length)} | ${cmds[cmd].description}${"â€ˆ".repeat(39 - cmds[cmd].description.length)} `).join('\n')}
                        `
                    }
                },
                theam: {
                    description: 'Change Theam',
                    usage: 'team',
                    fn: () => {
                        function white(e) {
                            document.body.style.background = '#ffffff'
                        }

                        function dark(e) {
                            document.body.style.background = '#000000'
                        }

                        function brightBlue(e) {
                            document.body.style.background = '#3B78FF'
                        }

                        function brightPurple(e) {
                            document.body.style.background = '#B4009E'
                        }

                        function brightYellow(e) {
                            document.body.style.background = '#F9F1A5'
                        }

                        terminal.current.pushToStdout(<button className={"btn1"} onClick={white}></button>)
                        terminal.current.pushToStdout(<button className={"btn2"} onClick={dark}></button>)
                        terminal.current.pushToStdout(<button className={"btn3"} onClick={brightBlue}></button>)
                        terminal.current.pushToStdout(<button className={"btn4"} onClick={brightPurple}></button>)
                        terminal.current.pushToStdout(<button className={"btn5"} onClick={brightYellow}></button>)
                    }
                },
                ssh: {
                    description: 'SSH conection',
                    usage: 'ssh <directory>',
                    fn: (...args) => {
                        //let sshurlarr =  args[0]
                        let sshurl = args[0]
                        // chrome.runtime.sendMessage({
                        //      type:'info',
                        //      value: sshurl
                        //
                        //  })
                        chrome.runtime.sendMessage({
                                  type:'info',
                                  value: sshurl
                        })
                        chrome.runtime.onMessage.addListener(function (request) {
                            if (request.type == 'data') {
                                console.log("Recived html:" + request.value)
                                const host = request.value
                                terminal.current.pushToStdout(request.value)
                                // setPrompt(`${host.join('/') + ">"}`)
                                }

                        })
                        if (args.length === 1) {
                            //console.log(dir)
                            return `ssh connection established ${args[0]}.`
                        } else {
                            return 'use ssh{username}@{hostname}'
                        }
                    }
                },
                exit: {
                    description: 'Leave the terminal ',
                    usage: 'exit',
                    fn: () => {
                        terminal.current.pushToStdout("error")
                    }
                },
                usb: {
                    description: 'Connect Usb to terminal',
                    usage: 'usb',
                    fn: async () => {
                        terminal.current.pushToStdout(alert("I am an alert box!"))
                    }
                },
                ...cmds
            }}
            promptLabel={prompt}
            autoFocus
            style={{
                backgroundColor: null,
                minHeight: null,
                maxHeight: null,
                overflow: 'auto',
                height: '100%',
                width: '100%',
            }}
            styleEchoBack='fullInherit'
            contentStyle={{color: '#ffb86c', fontWeight: 'normal', paddingLeft: null}} // Text colour
            promptLabelStyle={{color: '#00D100', fontWeight: 'normal'}} // Prompt label colour
            inputTextStyle={{color: '#f1fa8c', fontWeight: 'normal'}}
            messageStyle={{color: '#8be9fd', fontWeight: 'normal', paddingLeft: null}}
            scrollBehavior='auto'
            noDefaults
        />
    )
}
Term.propTypes = {
    welcomeimgae: PropTypes.string,
}
export default Term;